import React, { useState, useEffect } from "react";
import {
  Card,
  CardImg,
  CardText,
  CardBody,
  CardTitle,
  CardSubtitle,
  Button
} from "reactstrap";
import { Container, Row, Col } from "reactstrap";
import styled from "styled-components";
import axios from "axios";

const CardComp = ({ name, birthyear, eye, film, opening }) => {
  const Wrapper = styled.div`
    display: flex;
    justify-content: center;
    align-conent: center;
    margin: 2%;
  `;
  const filmTitle = [];

  //   console.log(f.title + "from cardcomp");
  return (
    <Container>
      <Row>
        <Col xs="6">
          <Card>
            <CardBody>
              <CardTitle>{name}</CardTitle>
              <CardSubtitle>Born in the great year of {birthyear}</CardSubtitle>
              <CardText>
                You don't know fear until you have stared into my steely {eye}{" "}
                eyes!
              </CardText>
              <Button>Next</Button>
            </CardBody>
          </Card>
        </Col>
        <Col xs="6">
          <Card>
            <CardBody>
              <CardTitle>{film}</CardTitle>
              {/* <CardSubtitle>Born in the great year of {birthyear}</CardSubtitle> */}
              <CardText>{opening}</CardText>
              {/* <Button>Next</Button> */}
            </CardBody>
          </Card>
        </Col>
      </Row>
    </Container>
  );
};

export default CardComp;
